import React from 'react';

function myFunction(s) {
    window.location.href = s;
}

const TLACMap = () => {
    return (
        <div>
            <h1>TLAC Map</h1>
            <svg viewBox="-221.3862 -119.8904 1078 945" width="1078" height="945" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                <image src="../data/tlac-map.png" width="1078" height="945" x="0" y="0" xlinkHref="../data/tlac-map.png"></image>
                
                <rect x="-154.966" y="205.371" width="95.836" height="182.304" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)" onclick="myFunction('building-4')" />
                <rect x="-115.695" y="386.413" width="128.262" height="95.836" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="18.69" y="383.711" width="55.485" height="95.836" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="78.858" y="385.153" width="275.258" height="95.836" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="126.055" y="9.817" width="226.259" height="95.836" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="354.476" y="40.8" width="93.675" height="278.14" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="100.475" y="249.765" width="61.25" height="95.836" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="231.618" y="259.854" width="65.573" height="63.41" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
                <rect x="586.998" y="464.615" width="162.85" height="44.676" style={{fill: "grey", stroke: "black", fillOpacity: 0.5}} transform="matrix(0.9999999999999999, 0, 0, 0.9999999999999999, 0, 0)"/>
            </svg>

        </div>
    );
};

export default TLACMap;
